(1, 'vi', '', 15, 'Xuân VI', 'Cao đẳng', 'Tiếng Hàn', '<p>Tiếng Việt</p>', '[{\"time\":\"9\\/2017 - 10\\/2021\",\"school\":\"Tr\\u01b0\\u1eddng Trung H\\u1ecdc Ph\\u1ed5 Th\\u00f4ng Ph\\u01b0\\u01a1ng T\\u00e2y Ng\\u00f4n ng\\u1eef Nh\\u1eadt\"},{\"time\":\"9\\/2017 - 10\\/2024\",\"school\":\"Tr\\u01b0\\u1eddng Trung H\\u1ecdc Ph\\u01b0\\u01a1ng \\u0110\\u00f4ng Ng\\u00f4n ng\\u1eef Nh\\u1eadt\"},{\"time\":\"30\\/2024 - Nay\",\"school\":\"Tr\\u01b0\\u1eddng \\u0110\\u1ea1i H\\u1ecdc Qu\\u1ed1c Gia H\\u00e0 N\\u1ed9i\"}]', '[{\"name\":\"Tin h\\u1ecdc\",\"description\":\"Am hi\\u1ec3u v\\u00e0 s\\u1eed d\\u1ee5ng th\\u00e0nh th\\u1ea1o c\\u00e1c ch\\u1ee9c n\\u0103ng n\\u00e2ng cao nh\\u01b0 \\u0111\\u1ecbnh d\\u1ea1ng v\\u0103n b\\u1ea3n, t\\u1ea1o b\\u1ea3ng bi\\u1ec3u, h\\u00e0m Excel, l\\u1ecdc v\\u00e0 ph\\u00e2n t\\u00edch d\\u1eef li\\u1ec7u\"},{\"name\":\"Photoshop \\/ Canva\",\"description\":\"Thi\\u1ebft k\\u1ebf c\\u01a1 b\\u1ea3n ph\\u1ee5c v\\u1ee5 truy\\u1ec1n th\\u00f4ng, thuy\\u1ebft tr\\u00ecnh, Th\\u00e0nh th\\u1ea1o Google Docs, Sheets, Slides.\"}]', '[{\"time\":\"06\\/2020 - 09\\/2023\",\"company\":\"C\\u00d4NG TY TNHH GLOBAL SOURCENET\",\"position\":\"Nh\\u00e2n vi\\u00ean xu\\u1ea5t nh\\u1eadp kh\\u1ea9u (M\\u1ea1nh v\\u1ec1 xu\\u1ea5t kh\\u1ea9u)\",\"description\":\"<p>\\u25cf&nbsp;&nbsp;&nbsp;&nbsp;Nh\\u1eadn th\\u00f4ng tin v\\u00e0 book c\\u00e1c l\\u00f4 h\\u00e0ng xu\\u1ea5t.<\\/p><p>\\u25cf&nbsp;&nbsp;&nbsp;&nbsp;Chu\\u1ea9n b\\u1ecb h\\u1ed3 s\\u01a1 ch\\u1ee9ng t\\u1eeb.<\\/p><p>\\u25cf&nbsp;&nbsp;&nbsp;&nbsp;Th\\u1ef1c hi\\u1ec7n khai v\\u00e0 truy\\u1ec1n t\\u1edd khai tr\\u00ean ph\\u1ea7n m\\u1ec1m khai b\\u00e1o h\\u1ea3i quan.<\\/p><p>\\u25cf&nbsp;&nbsp;&nbsp;&nbsp;Chu\\u1ea9n b\\u1ecb h\\u1ed3 s\\u01a1 v\\u00e0 th\\u1ef1c hi\\u1ec7n khai b\\u00e1o C\\/O form E, VK, VJ, B, EUR1<\\/p><p>\\u25cf&nbsp;&nbsp;&nbsp;&nbsp;L\\u00e0m vi\\u1ec7c v\\u1edbi Forwarder \\u0111\\u1ec3 ho\\u00e0n th\\u00e0nh giao c\\u00e1c l\\u00f4 h\\u00e0ng nhanh nh\\u1ea5t.<\\/p><p>\\u25cf&nbsp;&nbsp;&nbsp;&nbsp;Theo d\\u00f5i, qu\\u1ea3n l\\u00fd ti\\u1ebfn \\u0111\\u1ed9 c\\u1ee7a h\\u00e0ng h\\u00f3a v\\u00e0 ki\\u1ec3m so\\u00e1t s\\u1ed1 l\\u01b0\\u1ee3ng c\\u1ee7a s\\u1ea3n ph\\u1ea9m.<\\/p><p>\\u25cf&nbsp;&nbsp;&nbsp;&nbsp;Gi\\u1ea3i quy\\u1ebft nh\\u1eefng v\\u1ea5n \\u0111\\u1ec1 ph\\u00e1t sinh c\\u00f3 li\\u00ean quan \\u0111\\u1ebfn h\\u00e0ng h\\u00f3a, s\\u1ea3n ph\\u1ea9m trong qu\\u00e1 tr\\u00ecnh v\\u1eadn chuy\\u1ec3n.<\\/p><p>\\u25cf&nbsp;&nbsp;&nbsp;&nbsp;Qu\\u1ea3n l\\u00fd, l\\u01b0u tr\\u1eef c\\u00e1c ch\\u1ee9ng t\\u1eeb c\\u00f3 li\\u00ean quan,\\u2026..<\\/p><p>\\u25cf&nbsp;&nbsp;&nbsp;&nbsp;Th\\u1ef1c hi\\u1ec7n c\\u00e1c c\\u00f4ng vi\\u1ec7c kh\\u00e1c do Tr\\u01b0\\u1edfng ph\\u00f2ng ho\\u1eb7c Ban l\\u00e3nh \\u0111\\u1ea1o giao (n\\u1ebfu c\\u00f3)<\\/p>\"}]', '<p>●	Tốt nghiệp chuyên ngành Ngôn ngữ Nhật tại Đại học Phương Đông Đông</p><p>●		Có tổng 3 năm kinh nghiệm làm chuyên sâu về Xuất khẩu cho công ty chuyên gia công &amp; sản xuất quần áo thời trang nữ xuất khẩu trang thị trường EU,Mỹ, Nhật Bản… của Hàn Quốc, về phần Nhập khẩu có hiểu biết và làm phần thanh toán. Có kinh nghiệm trực tiếp khai báo hải quan, khai báo C/O form E, VK, VJ, B, EUR1 và theo dõi tiến độ hàng hóa và giải quyết những vấn đề phát sinh trong quá trình vận chuyển</p><p>●	Mức lương mong muốn: VND 13.500.000 Gross (có thể thương lượng thêm)</p><p>●	Thời gian bắt đầu đi làm: 1 tuần khi nhận được thông báo</p>', '', '', '2025-06-30 02:11:29', '2025-06-30 02:11:29'),
(2, 'en', '', 15, 'Xuân EN', 'College', 'Other foreign languages', '<p>Tiếng Anh</p>', '[{\"time\":\"9\\/2017 - 10\\/2021\",\"school\":\"Oriental Japanese Language High School\\n\"},{\"time\":\"30\\/2023 - 30\\/2024\",\"school\":\"Western Japanese Language High School\\n\"},{\"time\":\"30\\/2024 - Present\",\"school\":\"Vietnam National University, Hanoi\\n\"}]', '[{\"name\":\"Photoshop \\/ Canva\",\"description\":\"Basic design for communication, presentation, Proficient in Google Docs, Sheets, Slides.\"},{\"name\":\"Information technology\",\"description\":\"Am hi\\u1ec3u v\\u00e0 s\\u1eed d\\u1ee5ng th\\u00e0nh th\\u1ea1o c\\u00e1c ch\\u1ee9c n\\u0103ng n\\u00e2ng cao nh\\u01b0 \\u0111\\u1ecbnh d\\u1ea1ng v\\u0103n b\\u1ea3n, t\\u1ea1o b\\u1ea3ng bi\\u1ec3u, h\\u00e0m Excel, l\\u1ecdc v\\u00e0 ph\\u00e2n t\\u00edch d\\u1eef li\\u1ec7u\"}]', '[{\"time\":\"06\\/2020 - 09\\/2023\",\"company\":\"GLOBAL SOURCENET COMPANY LIMITED\",\"position\":\"Import-Export Staff (Strong in Export)\",\"description\":\"<p>\\u25cf Receive information and book export shipments.<\\/p><p>\\u25cf Prepare documents.<\\/p><p>\\u25cf Make declarations and transmit declarations on customs declaration software.<\\/p><p>\\u25cf Prepare documents and make declarations of C\\/O form E, VK, VJ, B, EUR1<\\/p><p>\\u25cf Work with Forwarders to complete shipments as quickly as possible.<\\/p><p>\\u25cf Monitor and manage the progress of goods and control product quantity.<\\/p><p>\\u25cf Resolve issues arising related to goods and products during transportation.<\\/p><p>\\u25cf Manage and store related documents, etc.<\\/p><p>\\u25cf Perform other tasks assigned by the Head of Department or Board of Directors (if any)<\\/p><p><br><\\/p>\"}]', '<p>● Graduated from the major of Japanese Language at the Oriental University of the East</p><p>● Has a total of 3 years of experience specializing in Export for a company specializing in processing &amp; manufacturing women\'s fashion clothing for export to the EU, US, Japan... markets of Korea, has knowledge and payment in the Import part. Has direct experience in customs declaration, declaration of C/O form E, VK, VJ, B, EUR1 and monitoring the progress of goods and resolving problems arising during the transportation process</p><p>● Desired salary: VND 13,500,000 Gross (negotiable)</p><p>● Start working time: 1 week after receiving notice</p><p><br></p>', '', '', '2025-06-30 02:11:29', '2025-06-30 02:11:29'),
(3, 'kr', '', 15, 'Xuân KR', '중급 수준', '한국인', '<p>Tiếng Hàn</p>', '[{\"time\":\"9\\/2017 - 10\\/2021\",\"school\":\"\\ub3d9\\uc591\\uc77c\\ubcf8\\uc5b4\\uace0\\ub4f1\\ud559\\uad50\"},{\"time\":\"30\\/2023 - 30\\/2024\",\"school\":\"\\uc11c\\ubd80\\uc77c\\ubcf8\\uc5b4\\uace0\\ub4f1\\ud559\\uad50\"},{\"time\":\"30\\/2024 - \\ud604\\uc7ac\",\"school\":\"\\ubca0\\ud2b8\\ub0a8 \\uad6d\\ub9bd\\ub300\\ud559\\uad50, \\ud558\\ub178\\uc774\"}]', '[{\"name\":\"\\uc815\\ubcf4 \\uae30\\uc220\",\"description\":\"\\ud14d\\uc2a4\\ud2b8 \\uc11c\\uc2dd \\uc9c0\\uc815, \\ud45c \\uc0dd\\uc131, Excel \\ud568\\uc218, \\ud544\\ud130\\ub9c1 \\ubc0f \\ub370\\uc774\\ud130 \\ubd84\\uc11d\\uacfc \\uac19\\uc740 \\uace0\\uae09 \\uae30\\ub2a5\\uc744 \\uc774\\ud574\\ud558\\uace0 \\uc219\\uc9c0\\ud569\\ub2c8\\ub2e4.\"},{\"name\":\"\\ud3ec\\ud1a0\\uc0f5 \\/ \\uce78\\ubc14\",\"description\":\"\\ucee4\\ubba4\\ub2c8\\ucf00\\uc774\\uc158, \\ud504\\ub808\\uc820\\ud14c\\uc774\\uc158\\uc744 \\uc704\\ud55c \\uae30\\ubcf8 \\ub514\\uc790\\uc778, Google Docs, Sheets, Slides \\uc0ac\\uc6a9\\uc5d0 \\ub2a5\\uc219\\ud569\\ub2c8\\ub2e4.\"}]', '[{\"time\":\"06\\/2020 - 09\\/2023\",\"company\":\"\\uae00\\ub85c\\ubc8c \\uc18c\\uc2a4\\ub137 \\ucef4\\ud37c\\ub2c8 \\ub9ac\\ubbf8\\ud2f0\\ub4dc\",\"position\":\"\\uc218\\ucd9c\\uc785 \\uc9c1\\uc6d0 (\\uc218\\ucd9c\\uc5d0 \\uac15\\ud568)\",\"description\":\"<p>\\u25cf \\uc218\\ucd9c \\ud654\\ubb3c\\uc5d0 \\ub300\\ud55c \\uc815\\ubcf4\\ub97c \\uc218\\uc2e0\\ud558\\uace0 \\uc608\\uc57d\\ud569\\ub2c8\\ub2e4.<\\/p><p>\\u25cf \\uc11c\\ub958\\ub97c \\uc900\\ube44\\ud569\\ub2c8\\ub2e4.<\\/p><p>\\u25cf \\uc138\\uad00 \\uc2e0\\uace0 \\uc18c\\ud504\\ud2b8\\uc6e8\\uc5b4\\ub97c \\ud1b5\\ud574 \\uc2e0\\uace0\\ud558\\uace0 \\uc2e0\\uace0 \\ub0b4\\uc6a9\\uc744 \\uc804\\uc1a1\\ud569\\ub2c8\\ub2e4.<\\/p><p>\\u25cf \\uc11c\\ub958\\ub97c \\uc900\\ube44\\ud558\\uace0 C\\/O \\uc591\\uc2dd E, VK, VJ, B, EUR1\\uc744 \\uc2e0\\uace0\\ud569\\ub2c8\\ub2e4.<\\/p><p>\\u25cf \\uc6b4\\uc1a1\\uc5c5\\uccb4\\