(271, 'vi', 'Nam', 25, 'Trần Xuân Bình', 'Cao đẳng', 'Tiếng Nhật', NULL, '[{\"time\":\"9\\/2017 - 10\\/2021\",\"school\":\"Tr\\u01b0\\u1eddng \\u0110\\u1ea1i H\\u1ecdc Ph\\u01b0\\u01a1ng \\u0110\\u00f4ng\\nNg\\u00f4n ng\\u1eef Nh\\u1eadt\"}]', '[{\"name\":\"Tin h\\u1ecdc \",\"description\":\"Am hi\\u1ec3u v\\u00e0 s\\u1eed d\\u1ee5ng th\\u00e0nh th\\u1ea1o Excel, Word..\"}]', '[{\"time\":\"Th\\u1eddi gian 1\",\"company\":\"C\\u00f4ng ty 1\",\"position\":\"V\\u1ecb tr\\u00ed 1\",\"description\":\"<p>N\\u1ed9i dung<\\/p>\"}]', '<p>● Tốt nghiệp chuyên ngành Ngôn ngữ Nhật tại Đại học Phương Đông Đông </p><p>● Có tổng 3 năm kinh nghiệm làm chuyên sâu về Xuất khẩu cho công ty chuyên gia công &amp; sản xuất quần áo thời trang nữ xuất khẩu trang thị trường EU,Mỹ, Nhật Bản… của Hàn Quốc, về phần Nhập khẩu có hiểu biết và làm phần thanh toán. Có kinh nghiệm trực tiếp khai báo hải quan, khai báo C/O form E, VK, VJ, B, EUR1 và theo dõi tiến độ hàng hóa và giải quyết những vấn đề phát sinh trong quá trình vận chuyển </p><p>● Mức lương mong muốn: VND 13.500.000 Gross (có thể thương lượng thêm)</p><p>● Thời gian bắt đầu đi làm: 1 tuần khi nhận được thông báo</p>', 'uploads/cv/2025/07/10/M9oJBlqLZD.docx', 'uploads/cv/2025/07/10/6ux7XWa9f1.docx', '2025-07-10 07:55:06', '2025-07-10 07:55:06'),
(272, 'en', 'Male', 25, 'Tran Xuan Binh', 'College', 'Japanese', NULL, '[{\"time\":\"9\\/2017 - 10\\/2021\",\"school\":\"Oriental University\\nJapanese Language\"}]', '[{\"name\":\"Information technology\",\"description\":\"Understand and proficient in Excel, Word..\"}]', '[{\"time\":\"06\\/2022 - Present\",\"company\":\"GLOBAL SOURCENET COMPANY LIMITED\",\"position\":\"Import-Export Staff (Strong in Export)\",\"description\":\"<p>\\u25cf Receive information and book export shipments.<\\/p><p>\\u25cf Prepare documents.<\\/p><p>\\u25cf Make declarations and transmit declarations on customs declaration software.<\\/p><p>\\u25cf Prepare documents and make declarations of C\\/O form E, VK, VJ, B, EUR1<\\/p><p>\\u25cf Work with Forwarders to complete shipments as quickly as possible.<\\/p><p>\\u25cf Monitor and manage the progress of goods and control product quantity.<\\/p><p>\\u25cf Resolve issues arising related to goods and products during transportation.<\\/p><p>\\u25cf Manage and store related documents, etc.<\\/p><p>\\u25cf Perform other tasks assigned by the Head of Department or Board of Directors (if any)<\\/p><p><br><\\/p>\"}]', '<p>● Graduated from the major of Japanese Language at the Oriental University</p><p>● Has a total of 3 years of experience in specialized Export for a company specializing in processing &amp; manufacturing</p><p>women\'s fashion clothing for export to the EU, US, Japan... markets of Korea, has knowledge and payment in the</p><p>Import part. Has direct experience in customs declaration, declaration</p><p>of C/O form E, VK, VJ, B, EUR1 and monitoring the progress of goods and resolving problems</p><p>arising during the transportation process</p><p>● Desired salary: VND 13,500,000 Gross (negotiable)</p><p>● Start date: 1 week after receiving notice</p>', 'uploads/cv/2025/07/10/7NfUTkIk1x.docx', 'uploads/cv/2025/07/10/H4yXjyWHWW.docx', '2025-07-10 07:55:06', '2025-07-10 07:55:06'),
(273, 'ja', '男', 25, 'チャン・スアン・ビン', 'カレッジ', '韓国人', NULL, '[{\"time\":\"9\\/2017 - 10\\/2021 \",\"school\":\"\\u30aa\\u30ea\\u30a8\\u30f3\\u30bf\\u30eb\\u5927\\u5b66\\n\\u65e5\\u672c\\u8a9e\"}]', '[{\"name\":\"\\u60c5\\u5831\\u6280\\u8853\",\"description\":\"Excel\\u3001Word \\u3092\\u7406\\u89e3\\u3057\\u3001\\u719f\\u7df4\\u3057\\u3066\\u3044\\u308b\\u3053\\u3068\\u3002\"}]', '[{\"time\":\"2022\\u5e746\\u6708 - \\u73fe\\u5728\",\"company\":\"\\u30b0\\u30ed\\u30fc\\u30d0\\u30eb\\u30bd\\u30fc\\u30b9\\u30cd\\u30c3\\u30c8\\u682a\\u5f0f\\u4f1a\\u793e\",\"position\":\" \\u8f38\\u51fa\\u5165\\u30b9\\u30bf\\u30c3\\u30d5\\uff08\\u8f38\\u51fa\\u306b\\u5f37\\u3044\\uff09\",\"description\":\"<p>\\u25cf \\u8f38\\u51fa\\u8ca8\\u7269\\u306b\\u95a2\\u3059\\u308b\\u60c5\\u5831\\u306e\\u53d7\\u9818\\u304a\\u3088\\u3073\\u8a18\\u9332\\u3002<\\/p><p>\\u25cf \\u66f8\\u985e\\u306e\\u6e96\\u5099\\u3002<\\/p><p>\\u25cf \\u901a\\u95a2\\u7533\\u544a\\u30bd\\u30d5\\u30c8\\u306b\\u3088\\u308b\\u7533\\u544a\\u304a\\u3088\\u3073\\u7533\\u544a\\u66f8\\u306e\\u9001\\u4fe1\\u3002<\\/p><p>\\u25cf C\\/O\\u30d5\\u30a9\\u30fc\\u30e0E\\u3001VK\\u3001VJ\\u3001B\\u3001EUR1\\u306e\\u66f8\\u985e\\u306e\\u6e96\\u5099\\u304a\\u3088\\u3073\\u7533\\u544a\\u3002<\\/p><p>\\u25cf \\u30d5\\u30a9\\u30ef\\u30fc\\u30c0\\u30fc\\u3068\\u9023\\u643a\\u3057\\u3001\\u8ca8\\u7269\\u8f38\\u9001\\u3092\\u53ef\\u80fd\\u306a\\u9650\\u308a\\u8fc5\\u901f\\u306b\\u5b8c\\u4e86\\u3055\\u305b\\u308b\\u3002<\\/p><p>\\u25cf \\u8ca8\\u7269\\u306e\\u9032\\u6357\\u72b6\\u6cc1\\u3092\\u76e3\\u8996\\u30fb\\u7ba1\\u7406\\u3057\\u3001\\u88fd\\u54c1\\u6570\\u91cf\\u3092\\u7ba1\\u7406\\u3059\\u308b\\u3002<\\/p><p>\\u25cf \\u8f38\\u9001\\u4e2d\\u306b\\u8ca8\\u7269\\u304a\\u3088\\u3073\\u88fd\\u54c1\\u306b\\u95a2\\u3057\\u3066\\u767a\\u751f\\u3059\\u308b\\u554f\\u984c\\u3092\\u89e3\\u6c7a\\u3059\\u308b\\u3002<\\/p><p>\\u25cf \\u95a2\\u9023\\u66f8\\u985e\\u7b49\\u306e\\u7ba1\\u7406\\u304a\\u3088\\u3073\\u4fdd\\u7ba1\\u3002<\\/p><p>\\u25cf \\u90e8\\u9580\\u9577\\u307e\\u305f\\u306f\\u53d6\\u7de0\\u5f79\\u4f1a\\uff08\\u8a72\\u5f53\\u3059\\u308b\\u5834\\u5408\\uff09\\u304b\\u3089\\u5272\\u308a\\u5f53\\u3066\\u3089\\u308c\\u305f\\u305d\\u306e\\u4ed6\\u306e\\u696d\\u52d9\\u3092\\u9042\\u884c\\u3059\\u308b\\u3002<\\/p>\"}]', '<p>● 東洋大学日本語学科卒業</p><p>● 韓国のEU、米国、日本などの市場向け婦人服の加工・製造を専門とする企業で、輸出業務に合計3年間従事した経験があり、輸入業務に関する知識と支払い経験を有しています。通関申告、C/OフォームE、VK、VJ、B、EUR1の申告、貨物の進捗状況の監視、輸送中に発生する問題の解決など、直接的な経験があります。</p><p>● 希望給与：13,500,000ドン（総額、交渉可能）</p><p>● 勤務開始日：通知受領後1週間</p><p><br></p>', 'uploads/cv/2025/07/10/CErUgtNHxi.docx', 'uploads/cv/2025/07/10/9yzKEYAH30.docx', '2025-07-10 07:55:06', '2025-07-10 07:55:06'),
